import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
function App() {
  return (
    <>
      <Header />
      <main>
        <h1>Welcome to ProShop</h1>
      </main>
      <Footer />
    </>
  );
}

export default App;
